syntax = "proto3";
//生成文件所在包名
option java_package = "com.gejian.pixel.proto";
//生成的java文件名
option java_outer_classname = "CommGetGiftbagListResponseProtobuf";

message	CommGetGiftbagListResponse  {
	optional	uint32	result = 10;
	optional	CommGetGiftbagListRequest	request = 11;
	repeated	Giftbag	giftbags = 12;
	repeated	PlayerItem	archives = 13;
}